const Counter = (props) => {

    const [counter, setCounter] = useState(0);



    const y = "Coming from Counter.js";
    const p = "Jacob";

    useEffect(() => {
        console.log("Just Loaded!");
    }, [])

    return (
      <div>
        <h1>{y}</h1>
        <h3>{`my name is ${props.name}`}</h3>
        <p>Counter: {counter}</p>
        <button onClick={() => setCounter(counter + 1)}>+1</button>
        <button onClick={() => setCounter(counter - 1)}>-1</button>
      </div>
    )
}

export default Counter;
